import React from 'react';


export function Content(){
    const props ={
        container: 'container',
        containerFluid: 'container-fluid'
    }

    return (
        <div className={containerFluid}>
            <div className='row'>
                <div className='col bg-primary'>1 of 4</div>
                <div className='col bg-secondary'>2 of 4</div>
                <div className='col bg-danger'>3 of 4</div>
                <div className='col bg-info'>4 of 4</div>
            </div>
        </div>
    )
}
